var arrLeague = [11,'法国甲组联赛','法國甲組聯賽','France Ligue 1','2015-2016','#663333','league_match/images/20130118151053.jpg',38,38,'法甲','法甲','FRA D1','　　法国足球甲级联赛共由20支球队组成，采取双循环赛制（每支球队分别以主、客场身份和其他球队交锋两次）。单场比赛积分计算方法是胜者得3分、负者得0分、平局则双方各得1分，赛季末按累计积分高低排名。积分相同的球队由净胜球和总进球数等来决定排名。&nbsp;<br/>　　联赛前两名直接参加下赛季冠军联赛，第三名取得参加下赛季冠军联赛外围赛的资格，联赛第四名参加下赛季欧罗巴联赛（法国杯和法国联赛杯冠军也可以参加欧罗巴联赛，如果法国杯冠军已经取得欧战资格，则其名额给足总杯亚军，而如果联赛杯冠军已经取得欧战资格，则其名额给联赛中排名靠前的球队）。联赛排名榜尾的2支球队下赛季将降到乙级。'];
